import React from 'react';

import Splash from './components/splashPage/splashIndex';
import Todo from './components/todo/todoIndex';
import Wine from './components/wineOrganizer/wineIndex';

const App = () => {
    return (
      <div>
        <Splash />
        <Todo />
        <Wine />
      </div>
    );
}

export default App;
